Plot:
Ashok (played by Shammi Kapoor), is on a lookout for a job. But that does not stop him from putting on airs and bluffing, pretending that he is from a rich family. As luck would have it, he get a job of a photographer for a fictitious tabloid - Bhukump, only to lose it, because he had the misfortune to click the photograph of the owner's daughter Seema (played by Saira Banu) slapping an eve teaser.
Never one to give up, he somehow meets her and convinces her of his good intentions. When she falls in love with him, Ashok tries to give up bluffing. But it is too late. No one believes him.

This movie has some immortal superhit gems :
1.Govinda Aala Re Aala by Rafi
2.Husn Chala Kuch Aisi Chaal by Rafi &amp; Lata
3.Socha Tha Pyaar Hum Na Karenge by Mukesh
4.Aye Dil, Ab Kahin Na Jaa by Hemant Kumar
5.Jabse Tujhe Jaan Gayi by Lata
6.Bedardi Dagabaaz by Lata
7.Chali Chali Kaisi Hawa Yeh Chali by Shamshad Begum &amp; Usha Mangeshkar

